    are primarily for travel and meeting expenses.   These limited administrative
    costs are fully disclosed on its reports.  The committee raises contributions
    from U.S. citizens living abroad. These citizens often use mailing addresses in
    the country in which they reside. To assure that each and every contributor who
    provides a foreign mailing address is a U.S. citizen or permanent resident entitled
    to contribute, the committee requires the contributor affirm that he or she is
    a U.S. citizen or permanent resident. Unless that affirmation is recorded, the
    committee will not accept or deposit any contribution from that individual.  Note
